const promisify = (fn) => (...args) => {
  return new Promise((resolve, reject) => {
    fn(...args, (error, result) => {
      if (error) reject(error);
      else resolve(result);
    });
  });
};

const chafa = await Chafa();
const imageToAnsi = promisify(chafa.imageToAnsi);
const imageToHtml = promisify(chafa.imageToHtml);
const imageToConsoleLogArgs = promisify(chafa.imageToConsoleLogArgs);

describe("ANSI", () => {
  it("imageData", async () => {
    const { ansi, config } = await imageToAnsi(data.imageData, data.config.in);
    assertEquals(ansi, data.ansi);
    assertEquals(config, data.config.out);
  });

  it("imageData (bad)", async () => {
    await assertRejects(async () => {
      await imageToAnsi(data.badImageData, data.config.in)
    });
  });

  it("PNG", async () => {
    const { ansi, config } = await imageToAnsi(data.png.buffer, data.config.in);
    assertEquals(ansi, data.ansi);
    assertEquals(config, data.config.out);
  });

  it("PNG (bad)", async () => {
    await assertRejects(async () => {
      await imageToAnsi(data.badPng.buffer, data.config.in)
    });
  });

  it("JPEG", async () => {
    const { ansi, config } = await imageToAnsi(data.jpeg.buffer, data.config.in);
    assertEquals(ansi, data.ansi);
    assertEquals(config, data.config.out);
  });

  it("JPEG (bad)", async () => {
    await assertRejects(async () => {
      await imageToAnsi(data.badJpeg.buffer, data.config.in)
    });
  });

  it("WebP", async () => {
    const { ansi, config } = await imageToAnsi(data.webp.buffer, data.config.in);
    assertEquals(ansi, data.ansi);
    assertEquals(config, data.config.out);
  });

  it("WebP (bad)", async () => {
    await assertRejects(async () => {
      await imageToAnsi(data.badWebp.buffer, data.config.in)
    });
  });
});

